import React from "react";
import "./About.css";

const About = () => {
  return (
    <div id="about">
      <p className="text">
        Dynamic and creative Software developer located in Marrakech. I have a
        strong passion for web development, dynamic user experiences and data
        analytics.
      </p>
    </div>
  );
};

export default About;
